import React, { useState } from 'react'

function Selector() {

    const [isOpen, setOpen] = React.useState(false);

    const radonClick = () => {
        setOpen(!isOpen);
    }

    const bc_maapClick = () => {
        setOpen(!isOpen);
    }
    
    const bc_mageeClick = () => {
        setOpen(!isOpen);
    }

    const mp_grimmClick = () => {
        setOpen(!isOpen);
    }

    const mpClick = () => {
        setOpen(!isOpen);
    }

    const radiometroClick = () => {
        setOpen(!isOpen);
    }

    return (
        <div>
            <button type="button" onClick={radonClick}>Radon</button>
            <button type="button" onClick={bc_maapClick}>BC-MAAP</button>
            <button type="button" onClick={bc_mageeClick}>BC-Magee</button>
            <button type="button" onClick={mp_grimmClick}>MP-GRIMM</button>
            <button type="button" onClick={mpClick}>Multi-parametro</button>
            <button type="button" onClick={radiometroClick}>Radiometro</button>
        </div>
    )
}

export default Selector;
